const DBVersion = 1;
const DBName = 'MDB';

class mdb {
    constructor() {
        this.version = DBVersion
    }

    starter() {
        // let openRequest = indexedDB.open(DBName, DBVersion);
    }

    getDB() {
        return [1, 2, 3];
    }
}

let MDB = new mdb();

export default MDB;
